        public $option_save_attachments = \true;
        /*
         * Optional calculations
         */
        /**
         * Get MD5 sum of data part - slow
         *
         * @var bool
         */
        public $option_md5_data = \false;
        /**
         * Use MD5 of source file if availble - only FLAC and OptimFROG
         *
         * @var bool
