         * '::'. This method expects a valid IPv6 address and expands the '::' to
         * the required number of zero pieces.
         *
         * Example:  FF01::101   ->  FF01:0:0:0:0:0:0:101
         *           ::1         ->  0:0:0:0:0:0:0:1
